import React, {Component} from 'react'
import './assets/css/Sidebar.scss'
import { text } from "../../list.txt"


class Sidebar extends Component {
    render() {
        return (
            <div className="sidebar">
                <div className="container"></div>
                <div>{text}</div>
            </div>
        )
    }
}

export default Sidebar
